import React, {Component} from 'react';
import Date from '../DateCalc/DateCalc'
import 'tachyons';

class Footer extends Component {
    render(){
        return(
            <footer class="pv1 ph3-m ph2-l dark-red bg-green bottom-0 w-100 o-70 fixed ">
                <div className='fr pr3'>
                    <a className='pa2' href="#" title="Facebook">
                        <img src="data:image/png;base64," class="dib h3" alt="Facebook" />
                    </a>
                    <a className='pa2' href="#" title="Instagram">
                        <img src="data:image/jpeg;base64," class="dib h3" alt="Instagram" />
                    </a>
                    <a className='pa2' href="#" title="Twitter">
                        <img src="https://images.vexels.com/media/users/3/137419/isolated/preview/b1a3fab214230557053ed1c4bf17b46c-twitter-icon-logo-by-vexels.png" class="dib h3" alt="Twitter" />
                    </a>
                </div>
                <div className='tc fl w-10 ml3 mb0 br3 pb1 mt2 bg-white dim dark-grey pb0 f3 f2-ns'>
                    <Date/>
                </div>

            </footer>
        );
    }
}

export default Footer;
